export default function Inventory() {

  return (
    
    <Box sx={{display: 'flex', alignItems: 'center', justifyContent: 'center', marginTop: '25px'}}>
        <TestCardTwo></TestCardTwo>
        <TestCardTwo></TestCardTwo>
        <TestCardTwo></TestCardTwo>
    </Box>
  );
}
